Input: If a freight train travels at a speed of 20  miles per hour for 6  hours,  how far will it travel?  Choices: a) 120  miles b) 80  miles c) 26  miles d) 12  miles 
 Output:
 First, I need to calculate the distance traveled by the train. The formula to calculate distance is speed multiplied by time. In this case, the train travels at a speed of 20 miles per hour for 6 hours. So, the distance is 20 * 6 = 120 miles. Therefore, the correct answer is {'sol': 'a'}

Input: Cat food costs $.47 /lb.  How much does a 6 -lb bag cost?  Choices: a) $2.82  b) $2.97  c) $6.47  d) $12.77  
 Output:
 First, I need to calculate the total cost of the 6-lb bag of cat food. To do this, I multiply the cost per pound ($0.47) by the number of pounds (6). So, the total cost is $0.47 * 6 = $2.82. Therefore, the correct answer is {'sol': 'a'}

Input: Jess scored 18  points during her last basketball game.  Each basket she made was worth 2  points.  How many baskets did she make?  Choices: a) 20  b) 16  c) 9  d) 8  
 Output:
 First, I need to determine how many baskets Jess made based on the points she scored. Since each basket is worth 2 points, I divide the total points by 2: 18 ÷ 2 = 9 baskets. Therefore, the correct answer is {'sol': 'c'}

Input: Rich measures the width of one cardboard strip as 5  over 6  ft.  A second cardboard strip is 2  over 3  ft wide.  Estimate the combined width of the cardboard strips.  Choices: a) 2  ft b) 1  and 1  over 2  ft c) 1  ft d) 3  ft 
 Output:
 First, I need to find the combined width of the two cardboard strips. To do this, I add the widths of the two strips together. The width of the first strip is 5/6 ft, and the width of the second strip is 2/3 ft. To add these fractions, I need a common denominator. The least common denominator for 6 and 3 is 6. So, I convert 2/3 to 4/6 to have the same denominator. Now, I can add the fractions: 5/6 + 4/6 = 9/6. Simplifying 9/6, I get 1 3/6, which can be further simplified to 1 1/2. Therefore, the combined width of the cardboard strips is approximately 1 and 1 over 2 ft. The correct answer is {'sol': 'b'}

Input: A car gets 24  miles per gallon of gasoline (mi/gal).  How many gallons of gasoline would the car need to travel 144  miles?  Choices: a) 6.5  gallons b) 6  gallons c) 5.5  gallons d) 5  gallons 
 Output:
 First, I need to calculate the total gallons of gasoline needed to travel 144 miles. To do this, I divide the total distance by the car's fuel efficiency: 144 miles ÷ 24 mi/gal = 6 gallons. Therefore, the correct answer is {'sol': 'b'}

Input: Roya paid $48  for 12  cartons of orange juice.  What is the unit rate per carton of orange juice that Roya paid?  Choices: a) $3  b) $4  c) $6  d) $12  
 Output:
 First, I need to calculate the total cost of one carton of orange juice. To find the unit rate, I divide the total cost by the number of cartons: $48 ÷ 12 cartons = $4 per carton. Therefore, the correct answer is {'sol': 'b'}

Input: Shodi earned 389  points in the first level of her video game.  She earned an additional 116  points in the bonus round.  How many points in total did Shodi earn in the first level and bonus round of her video game?  Choices: a) 405  b) 495  c) 505  d) 4,915  
 Output:
 First, I need to calculate the total points Shodi earned in both the first level and the bonus round. To do this, I add the points from the first level to the points from the bonus round: 389 + 116 = 505. Therefore, the correct answer is {'sol': 'c'}

